lladay (hip) but with a hobbled quarterback - Matthew Stafford was toughing out a thumb injury - it's beyond clear at this point that Peterson simply lacks the burst he once brought to the table. With that said, Detroit has Houston on deck. If there's ever a setup where Peterson could eat, it's probably a home matchup against a Texans defense allowing a league-high 5.2 yards per carry, but that's only if Swift remains sidelined.\",\"title\":\"Shut down by Panthers\"},{\"timeEpochMilli\":\"1606079615000\",\"contents\":\"Detroit Lions running back Adrian Peterson carried the ball seven times for 18 yards in the Lions 20-0 loss to the Panthers in Week 11. The Lions were without ascending talent D'Andre Swift in the backfield due to a concussion and Peterson led the team in touches in the running game. But the Lions offense was abysmal, totaling only 40 team rushing yards, and only 185 total yards of offense as a team. The Lions will now turn around and play on Thanksgiving against the Texans and Swift may not ...\",\"url\":\"https://www.rotoballer.com/player-news/adrian-peterson-musters-only-18-yards/806775\",\"title\":\"Adrian Peterson Musters Only 18 Yards\"}],\"nameFirst\":\"Adrian\",\"nameLast\":\"Peterson\",\"proTeam\":{\"abbreviation\":\"DET\",\"location\":\"Detroit\",\"name\":\"Lions\"},\"positionEligibility\":[\"RB\"]},\"requestedGames\":[{\"game\":{\"id\":6302,\"away\":{\"abbreviation\":\"DET\",\"location\":\"Detroit\",\"name\":\"Lions\"},\"home\":{\"abbreviation\":\"CAR\",\"location\":\"Carolina\",\"name\":\"Panthers\"},\"startTimeEpochMilli\":\"1606068000000\",\"status\":\"FINAL_SCORE\",\"homeScore\":20,\"period\":{\"ordinal\":11,\"startEpochMilli\":\"1605610800000\",\"isNow\":true},\"homeResult\":\"WIN\",\"awayResult\":\"LOSE\"},\"stats\":[{\"category\":{\"id\":22,\"abbreviation\":\"Yd\",\"nameSingular\":\"Rushing Yard\",\"namePlural\":\"Rushing Yards\"},\"value\":{\"value\":18.0,\"formatted\":\"18\"}},{\"category\":{\"id\":175,\"abbreviation\":\"Rec\",\"na